import React from 'react';
import ReactDOM from 'react-dom';
import {add,sub,mul,div} from './App';
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <React.Fragment>
        <ul>
            <li>Sum Of Two Number is : { add(10,30) }</li>
            <li>Sub Of Two Number is : { sub(40,34) }</li>
            <li>Mul Of Two Number is : { mul(12,23) }</li>
            <li>Division Of Two Number is : { div(12,21) }</li>
        </ul>
    </React.Fragment>
);
